import { createStackNavigator } from 'react-navigation-stack'
import SignUp from './components/SignUp'

const navOptionHandler = (navigation) => ({
    header: null
})

export const MyStack = createStackNavigator({
    SignUp: {
        screen: SignUp,
        navigationOptions: navOptionHandler
    }
})
